import React, { Component } from "react";
import Calendar from "react-calendar";

class ReactCalendar extends Component {
  state = {
    d: new Date()
  };

  onChange = d => {
    this.setState(d);
  };

  render() {
    return (
      <div>
        <Calendar onChange={this.onChange} value={this.state.d} />
      </div>
    );
  }
}
export default ReactCalendar;
